// redux/actions.js
export const setCart = (cartData) => ({
    type: 'SET_CART',
    payload: cartData,
  });
  
  export const addCart = (item) => ({
    type: 'ADD_TO_CART',
    payload: item,
  });
  
  export const delCart = (item) => ({
    type: 'REMOVE_FROM_CART',
    payload: item,
  });
